import React, { useState } from 'react';

const BookingForm = (props) => {
    const [date, setDate] = useState("");
    const [times, setTimes] = useState("");

    const handleSubmit = (e) => {
        e.preventDefault();
        // Here, you can handle form submission logic or dispatch an action using Redux
    }

    const handleDateChange = (e) => {
        setDate(e.target.value);
    };

    const handleTimeChange = (e) => {
        setTimes(e.target.value);
    };

    return (
        <header>
            <section>
                <form onSubmit={handleSubmit}>
                    <fieldset>
                        <div>
                            <label htmlFor='book-date'>Choose Date:</label>
                            <input id='book-date' value={date} onChange={handleDateChange} type='date' required/>
                        </div>

                        {/* Time field */}
                        <div>
                            <label htmlFor='book-time'>Choose Your Time:</label>
                            <select id="book-time" value={times} onChange={handleTimeChange}>
                                <option value="">Select Time</option>
                                {props.availableTimes.map(time => <option key={time}>{time}</option>)}
                            </select>
                        </div>
                    </fieldset>
                    <button type="submit">Submit</button>
                </form>
            </section>
        </header>
    );
};

export default BookingForm;
